export const findUserById = (idUser) => {
  const userFind = users.find((user) => user.id === idUser);
  return userFind;
};
export const authentification = async (email, password) => {
  return new Promise(function (resolve, reject) {
    let userFind = users.find(
      (user) => user.email === email && user.password === password
    );
    if (userFind === undefined) {
      reject("votre email et votre password sont incorrectes");
    } else {
      if (userFind.role === "admin") resolve(userFind);
      else {
        if (userFind.banni === true) reject("vous étes banni :)");
        else resolve(userFind);
      }
    }
  });
};
